import React, { useState } from 'react';

import '../styles/Appointment.css'

const Appointment = () => {
    const [data, setData] = useState({name:"", email:"", message:""});
    const handleChange = (e) => {
        const name = e.target.name;
        const value = e.target.value;
        setData({...data, [name]: value})
    }

    const handleSubmit = (e) => {
        e.preventDefault()
        console.log(data);
    }

  return (
    <div className="form">
        <form method="post" onSubmit={handleSubmit}>
         <h1>Appointment <span>Form</span></h1>
         <input type="text" className="name" id="" onChange={handleChange} value={data.name} placeholder='Enter Full Name' />
         <input type="email" className="email" id="" onChange={handleChange} value={data.email} placeholder='Sample@gmail.com' />
         <input type="phone" className="phone" id="" onChange={handleChange} value={data.phone} placeholder='Enter Phone' />
         <textarea name="message" id="" cols="30" onChange={handleChange} value={data.message} rows="5" placeholder='Type Here...'/>
         <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Appointment;
